import React from 'react';
import Navbar from './Navbar';
import Slider from './Slider';
import BodyContent from './BodyContent';
import Footer from './Footer';
import SecondaryNavbar from './SecondaryNavbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <SecondaryNavbar/>
      <Slider />
      {/* <BodyContent /> */}
      <Footer />
    </div>
  );
}

export default App;
